import React from "react";
import Header from './Header'
import Corps from "./Corps"
import Game2 from "./Game2"
import imgP from "../img/icon-paper.svg"
import imgR from "../img/icon-rock.svg"
import imgS from "../img/icon-scissors.svg"



class Jeu extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            affichage: false
        }

    }
    


    render() { 
        return (
            <div className="bgAll ">
                
                
                <div>
                    <Game2
                    image = {imgP}
                    image2 = {imgR}
                    image = {imgS}
                    />
                </div>
            
            </div>
            
        );
    }
}

export default Jeu;
